import React from 'react';
import '../components/StickyNavigation';
import '../components/SideHeader';
import '../components/TopNavigation';
import '../components/BannerAd';
import '../components/AboutUsWidget';
import '../components/FeaturedPostWidget';

const StandardLayout = (props) => {
	return (
		<div id="page-container">
			<StickyNavigation />
			<div id="page-content" class="page-content">
				<SideHeader/>
				<div id="content" class="content">
					<TopNavigation/>
					<main id="primary-content">
						<div class="main-wrapper">
							{props.children}
						</div>
					</main>
					<BannerAd />
					<div id="secondary-content">
						<div class="widget-area">
							<aside class="widget">
								<FeaturedPostWidget/>
							</aside>
							<aside class="widget">
								<AboutUsWidget/>
							</aside>
						</div>
					</div>
				</div>
			</div>
		</div>
	);
}
